import { createMuiTheme } from '@material-ui/core/styles'
import { brown } from '@material-ui/core/colors'

const theme = createMuiTheme({
    typography: {
      useNextVariants: true,
    },
    palette: {
      primary: {
      light: 50,
      main: 400,
      dark: 900,
      contrastText: '#fff',
    },
    secondary: {
      light: '#ff79b0',
      main: '#ff4081',
      dark: '#c60055',
      contrastText: '#000',
    },
      openTitle: '#3f4771',
      protectedTitle: brown['400'],
      type: 'light'
    }
})

export default theme
